const PrototypeExtension = require("prototype-extension")


class TestModule
{
	static testMethod(self)
	{
		return TestModule.name + "." + TestModule.testMethod.name;
	}

	static testForLambda(self)
	{
		return TestModule.name + "." + TestModule.testForLambda.name;
	}
}

TestModule.lambda = () => (TestModule.name + ".lambda")

function method()
{
	return {}._.testMethod()
}

PrototypeExtension.extendWith(Object, TestModule)

module.exports = {
	isImported: true,
	lambda: () => ({}._.testForLambda()),
	fullLambda: () => ({}._.lambda()),
	method,
	configAccessor: !!{}.$$
}
